package Test;

public class SwitchExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int number=5;
		switch(number){
		case 10: System.out.println("This is Ten");
		break;
		case 20: System.out.println("This is Twenty");
		break;
		case 40: System.out.println("This is Fourty");
		break;
		case 50: System.out.println("This is Fifty");
		break;
		default:System.out.println("Out of Range");
			
		}

	}

}
